description:
Movie Info: Nadodimannan is a 2013 Malayalam film directed by Viji Thampi, starring Dileep, Ananya, Mythili and Archana Kavi in the lead roles. Dileep and Viji Thampi collaborated after 17 years in this movie. This film was successful at box office.

